import React, { useState } from 'react';
import './PrescriptionForm.css';

const PrescriptionForm = () => {
  const [medicines, setMedicines] = useState([{
    medicineName: '',
    dosage: '',
    quantity: 0,
    frequency: '',
    instructions: ''
  }]);
  const [patientId, setPatientId] = useState('');
  const [doctorId, setDoctorId] = useState('');
  const [validUntil, setValidUntil] = useState('');
  const [notes, setNotes] = useState('');

  const handleMedicineChange = (index, event) => {
    const values = [...medicines];
    values[index][event.target.name] = event.target.value;
    setMedicines(values);
  };

  const addMedicine = () => {
    setMedicines([
      ...medicines,
      { medicineName: '', dosage: '', quantity: 0, frequency: '', instructions: '' }
    ]);
  };

  const removeMedicine = (index) => {
    const values = [...medicines];
    values.splice(index, 1);
    setMedicines(values);
  };

  const handleSubmit = (event) => {
    event.preventDefault();
    const prescriptionData = { medicines, patientId, doctorId, validUntil, notes };
    console.log('Prescription Data:', prescriptionData);
  };

  return (
    <div className="form-container">
      <h1 className="form-title">Prescription Form</h1>
      <form onSubmit={handleSubmit} className="prescription-form">
        <div className="medicines-section">
          <h2>Medicines</h2>
          {medicines.map((medicine, index) => (
            <div className="medicine-entry" key={index}>
              <input
                type="text"
                name="medicineName"
                value={medicine.medicineName}
                onChange={(e) => handleMedicineChange(index, e)}
                placeholder="Medicine Name"
                className="input-field"
              />
              <input
                type="text"
                name="dosage"
                value={medicine.dosage}
                onChange={(e) => handleMedicineChange(index, e)}
                placeholder="Dosage"
                className="input-field"
              />
              <input
                type="number"
                name="quantity"
                value={medicine.quantity}
                onChange={(e) => handleMedicineChange(index, e)}
                placeholder="Quantity"
                className="input-field"
              />
              <input
                type="text"
                name="frequency"
                value={medicine.frequency}
                onChange={(e) => handleMedicineChange(index, e)}
                placeholder="Frequency"
                className="input-field"
              />
              <input
                type="text"
                name="instructions"
                value={medicine.instructions}
                onChange={(e) => handleMedicineChange(index, e)}
                placeholder="Instructions"
                className="input-field"
              />
              <button type="button" onClick={() => removeMedicine(index)} className="remove-btn">
                Remove
              </button>
            </div>
          ))}
          <button type="button" onClick={addMedicine} className="add-btn">
            Add Medicine
          </button>
        </div>
        
        <div className="input-group">
          <label>Patient ID</label>
          <input
            type="text"
            value={patientId}
            onChange={(e) => setPatientId(e.target.value)}
            className="input-field"
          />
        </div>
        
        <div className="input-group">
          <label>Doctor ID</label>
          <input
            type="text"
            value={doctorId}
            onChange={(e) => setDoctorId(e.target.value)}
            className="input-field"
          />
        </div>

        <div className="input-group">
          <label>Valid Until</label>
          <input
            type="date"
            value={validUntil}
            onChange={(e) => setValidUntil(e.target.value)}
            className="input-field"
          />
        </div>

        <div className="input-group">
          <label>Notes</label>
          <textarea
            value={notes}
            onChange={(e) => setNotes(e.target.value)}
            className="input-field"
            rows="4"
          />
        </div>

        <button type="submit" className="submit-btn">
          Submit Prescription
        </button>
      </form>
    </div>
  );
};

export default PrescriptionForm;
